import React from 'react';
import styles from './Header.module.css';
import NavMenu from "./NavMenu";

function Header() {
    return (
        <div className={styles.header}>
            <div className={styles.container}>
                <NavMenu/>
                <div id='stars'/>
                <div id='stars2'/>
                <div id='stars3'/>
                <div id='title'/>
            </div>
        </div>
    )
};
export default Header;
